def get_indexer(
    self,
    target: AnyArrayLike,
    method: Optional[str] = None,
    limit: Optional[int] = None,
    tolerance: Optional[Any] = None,
) -> np.ndarray:
    if method is not None:
        raise NotImplementedError(
            "Specifying method argument is not yet implemented."
        )

    if self.is_overlapping():
        raise InvalidIndexError("cannot handle overlapping indices; use IntervalIndex.get_indexer_non_unique")

    target_as_index = ensure_index(target)

    if isinstance(target_as_index, IntervalIndex):
        return super().get_indexer(target_as_index, method, limit, tolerance)

    elif isinstance(target_as_index, CategoricalIndex):
        return super().get_indexer(target_as_index, method, limit, tolerance)

    else:
        raise ValueError("Unsupported index type")
